import React from "react";

function Test() {
  return (
    <div>
      <form
        autoComplete="off"
        onSubmit={(e) => {
          e.preventDefault();
          const username = e.target.elements.usernameInput.value;
          if (!username) {
            return alert("Please enter username");
          } else {
            return getUser(username);
          }
        }}
      >
        <input />
      </form>
    </div>
  );
}

export default Test;
